import React from 'react';
import { ServHead } from './components/header';
import { NavLink } from 'react-router-dom';
import { Main } from './components';

class Child extends React.Component{
	render(){
			const style = {
					backgroundImage: "url("+this.props.image+")",
					backgroundSize: "100% 100%"
			}
			return(
					<div style={style}></div>
			)
	}
}

export const Services = () => (
	<main>
		<ServHead />
		<Main>
			<div className="lh-title">
				<p className="f1 fw7 futura pb3">Design</p>
				<a href="#" className="link mw5 dt hide-child br2 cover bg-center">
					<span className="white dtc v-mid w-100 h-100 child bg-black-40 pa5">
						Card title
					</span>
				</a>
				<p className="f1 fw7 futura pv3">Fotografia</p>
				<p className="f25 fw2 futura pv2">Immagini coordinate</p>
			</div>
		</Main>
	</main>
);
